    "#SGD参数优化\n",
    "import tensorflow as tf\n",
    "opt = tf.keras.optimizers.Adagrad(\n",
    "    learning_rate=0.06, initial_accumulator_value=0.1, epsilon=1e-07)\n",
    "var = tf.Variable(1.0)\n",
    "def loss(): return (var ** 2)/2.0\n",
    "opt.minimize(loss, [var]).numpy()\n",
    "var.numpy()"
